function draw(){
    var initialProps = {
        dims: {
          single: { width: 270, height: 125 },
          double: { width: 580, height: 250}
        },
    };

    var werk = werkHelper.build(initialProps);
    console.log(werk.data);

	var comma = d3.format(",");

    var map = d3.map(werk.data, function(d){ return d.county; }),
        path = d3.geoPath();

	var svg = d3.select("#chart").append("svg")
      .style("background-color","transparent")
        .attr("width", werk.dims.svg.width + werk.dims.margins.left + werk.dims.margins.right)
        .attr("height", werk.dims.svg.height + werk.dims.margins.top + werk.dims.margins.bottom)
      .append("g")
        .attr("transform", "translate(" + werk.dims.margins.left + "," + werk.dims.margins.top + ")");


    function getCounty(d){
        // Uses properties in topojson to retrieve the correct datum in your
        // user's data. Should handle most use cases, but you may need to customize
        // for individual states.
        return map.get(d.properties.state + d.properties.county) || // Full fips
            map.get(d.properties.county) || // Just county fips
            map.get(werkHelper.slugify(d.properties.name)) || // Full county name, ie, Fulham County
            map.get(werkHelper.slugify(d.properties.name.replace(' County', ''))) // Just the name
            false;
    }

    d3.json("https://www.politico.com/interactives/elections/data/geography/2016/state/51/counties.json", function(error, geoData){


        var features = topojson.feature(geoData, {
            type: 'GeometryCollection',
            geometries: geoData.objects['-'].geometries,
        });

        var path = d3.geoPath()
          .projection(d3.geoMercator()
            .fitSize([werk.dims.svg.width, werk.dims.svg.height], features));

        var mapG = svg.append("g")
            .attr("id", "counties")
            .attr("width", werk.dims.svg.width)
            .attr("height", werk.dims.svg.height);

        var counties = mapG.selectAll("path")
            .data(features.features);

        counties.enter().append("path")
            .attr('d', path)
            .attr("class", "county")
            .style('fill', function(d){
                if (getCounty(d)) {
                    return werk.scales.color(getCounty(d).value);
                }
                return '#e2e2e2';
            })
            .style("stroke", "#ccc")
            .on("mouseover",function(d){

                if (getCounty(d)) {
                    d3.select(this)
                      .style("stroke", "black")
                      .moveToFront();

                    d3.select(".tooltip .title")
                      .text(d.properties.name);

                    d3.select(".tooltip .value")
                      .text(function(){
                          var s = chartwerk.axes.scale;
                          var data = getCounty(d);
                          if (data) {
                              if (data.tooltip){
                                  return data.tooltip;
                              } else {
                                  return chartwerk.axes.color.quantize ? 
                                    s.prefix + comma(data.value) + s.suffix : data.value;
                              }
                          }
                      });

                    var p = d3.mouse(this.parentElement.parentElement);

                    d3.select(".tooltip")
                        .style("opacity", 1)
                        .style("top",function(){
                            return p[1].toString() + "px";
                        })
                        .style("left", function(){
                            // We position either left or right of the mouse point based
                            // on whether we're past the midpoint of the chart. This protects
                            // against tooltips overflowing embedded iframes.
                            var s = chartwerk.ui.size,
                                w = werk.dims[s].width,
                                tipW = parseInt(d3.select(".tooltip").style("width"), 10),
                                pos = p[0] > (w / 2) ?
                                    p[0] - (tipW - 10) : p[0] + 40;
                            return pos.toString() + "px";
                        });
                }
            })
            .on("mouseout",function(){
                d3.select(this)
                  .style("stroke","#ccc")
                  .style('fill', function(d){ 
                    if (getCounty(d)) {
                        return werk.scales.color(getCounty(d).value);
                    }
                    return '#e2e2e2';
                });
                d3.select(".tooltip")
                    .style("opacity", 0);
            });
    });

    var tooltip = d3.select("#chart")
      .append("div")
        .attr("class","tooltip")
        .style("position","absolute");
    tooltip
      .append("div")
      .attr("class","title")
      .text(chartwerk.datamap.scale);
    tooltip
      .append("div")
      .attr("class","value");
}

scripts.helper:
var werkHelper = {
    prototype: function() {
        d3.selection.prototype.moveToFront = function() {
          return this.each(function(){
            this.parentNode.appendChild(this);
          });
        };
    },

    slugify: function(text){
        return text ? text.toString().toLowerCase()
            .replace(/\s+/g, '-')
            .replace(/[^\w\-]+/g, '')
            .replace(/\-\-+/g, '-')
            .replace(/^-+/, '')
            .replace(/-+$/, '') : text;
    },

    parse: function(werk){
        var localslugify = this.slugify;
        werk.data = chartwerk.data.map(function(d){
            return {
                county: localslugify(d[chartwerk.datamap.base]),
                value: +d[chartwerk.datamap.scale],
                // value: chartwerk.axes.color.quantize ? 
                //     +d[chartwerk.datamap.scale] : d[chartwerk.datamap.scale],
                tooltip: chartwerk.datamap.custom.tooltip !== '' ?
                    d[chartwerk.datamap.custom.tooltip] : null,
            };
        });
    },

    dims: function(werk){
        var s = chartwerk.ui.size;
            w = werk.dims[s].width,
            h = werk.dims[s].height,
            margins = {
                right: chartwerk.margins[s].right * w,
                left: chartwerk.margins[s].left * w,
                top: chartwerk.margins[s].top * h,
                bottom: chartwerk.margins[s].bottom * h
            },
            svg = {
                width: w - margins.left - margins.right,
                height: h - margins.top - margins.bottom
            };

        werk.dims.margins = margins;
        werk.dims.svg = svg;
    },

    scales: function(werk){
        var svg = werk.dims.svg;
        werk.scales = {
            color: chartwerk.axes.color.quantize ? 
                d3.scaleThreshold() : d3.scaleOrdinal(),
        };

        werk.scales.color
            .domain(chartwerk.axes.color.domain)
            .range(chartwerk.axes.color.range);
    },

    // Build dims, scales and axes.
    build: function(werk){
        this.prototype();
        this.parse(werk);
        this.dims(werk);
        this.scales(werk);
        return werk;
    },
};

